import {connect} from 'react-redux';


function SavedPosts({save}) {
    return (
        <div>
            <h1>Saved</h1>
        </div>
    )
}

const mapStateToProps = state => {
    return {
        save:state.savedPost.savedPost
    }
}

export default connect(mapStateToProps,null)(SavedPosts);
